const Button = ({ active, text, ...btnProps }) => {

    const StartButton = (
        <div className="btn btn-one btn-start"
            onClick={btnprops.pressStart}>
            Start
        </div>
    );
    const ActiveButtons = (
        <div className="btn-grp">
            <div className="btn btn-two"
                onClick={btnprops.pressReset}>
                Reset
            </div>
            <div className="btn btn-one"
                onClick={btnprops.pressPauseResume}>
                {btnprops.isPaused ? "Resume" : "Pause"}
            </div>
        </div>
    );
    return (
        <button
        className={active ? "Default-button Default-button-active" : "Default-button"}
        {...btnProps}
        >
        {text}
        </button>
    );
};

export default Button;
